import {
  Box,
  Container,
  Flex,
  Heading,
  Text,
  Button,
  Input,
  Textarea,
  FormLabel,
  FormControl,
  Link,
  useColorMode,
} from "@chakra-ui/react";
import React from "react";

function Contact() {
  const { colorMode } = useColorMode();
  const [name, setName] = React.useState("");
  const [email, setEmail] = React.useState("");
  const [message, setMessage] = React.useState("");

  function encode(data) {
    return Object.keys(data)
      .map(
        (key) => encodeURIComponent(key) + "=" + encodeURIComponent(data[key])
      )
      .join("&");
  }

  function handleSubmit(e) {
    e.preventDefault();
    fetch("http://localhost:3000/send-email", {
      // Adjust the URL if deploying
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ name, email, message }),
    })
      .then((response) => {
        if (response.ok) {
          alert("Message sent!");
        } else {
          alert("Error sending message.");
        }
      })
      .catch((error) => alert(error));
  }

  return (
    <Box
      id="contact"
      bg={colorMode === "light" ? "gray.100" : "gray.900"}
      color={colorMode === "light" ? "gray.800" : "gray.400"}
      py={20}
      bgSize="cover"
      bgPosition="center"
    >
      <Container maxW="container.xl" mx="auto" px={10}>
        <Flex justify="space-between" align="center" flexWrap="wrap">
          <Box flexBasis={{ base: "100%", md: "50%" }} pr={{ md: 10 }}>
            <Heading
              as="h2"
              fontSize={{ base: "4xl", md: "5xl" }}
              mb={4}
              color={colorMode === "light" ? "gray.900" : "white"}
              fontWeight="bold"
            >
              Get in Touch
            </Heading>
            <Text
              fontSize="lg"
              mb={8}
              color={colorMode === "light" ? "gray.600" : "gray.400"}
            >
              As a graphic designer, I'm eager to collaborate on innovative
              visual projects and help bring your ideas to life. If you have a
              design concept or need assistance with branding, feel free to
              reach out!
            </Text>
            <Flex justify="space-between" align="center" mb={8}>
              <Button
                as={Link}
                href="mailto:ezedinebrahim131@gmail.com"
                variant="solid"
                colorScheme="green"
                size="lg"
                borderRadius="md"
                boxShadow="md"
                _hover={{ boxShadow: "lg" }}
              >
                Email Me
              </Button>
              <Button
                as={Link}
                href="https://www.linkedin.com/in/ezedin-ebrahim-11a01732b/"
                variant="outline"
                colorScheme="gray"
                size="lg"
                borderRadius="md"
                boxShadow="md"
                _hover={{ bg: "gray.200", borderColor: "gray.400" }}
              >
                Connect on LinkedIn
              </Button>
            </Flex>
          </Box>
          <Box flexBasis={{ base: "100%", md: "50%" }} pl={{ md: 10 }}>
            <form netlify name="contact" onSubmit={handleSubmit}>
              <FormControl isRequired mb={4}>
                <FormLabel
                  fontSize="lg"
                  mb={2}
                  color={colorMode === "light" ? "gray.900" : "white"}
                >
                  Name
                </FormLabel>
                <Input
                  type="text"
                  id="name"
                  name="name"
                  value={name}
                  onChange={(e) => setName(e.target.value)}
                  placeholder="Your Name"
                  fontSize="lg"
                  borderColor={colorMode === "light" ? "gray.400" : "gray.500"}
                  _focus={{
                    borderColor: "green.500",
                    boxShadow: "0 0 0 1px green.500",
                  }}
                  borderRadius="md"
                  p={4}
                />
              </FormControl>
              <FormControl isRequired mb={4}>
                <FormLabel
                  fontSize="lg"
                  mb={2}
                  color={colorMode === "light" ? "gray.900" : "white"}
                >
                  Email
                </FormLabel>
                <Input
                  type="email"
                  id="email"
                  name="email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  placeholder="Your Email"
                  fontSize="lg"
                  borderColor={colorMode === "light" ? "gray.400" : "gray.500"}
                  _focus={{
                    borderColor: "green.500",
                    boxShadow: "0 0 0 1px green.500",
                  }}
                  borderRadius="md"
                  p={4}
                />
              </FormControl>
              <FormControl isRequired mb={4}>
                <FormLabel
                  fontSize="lg"
                  mb={2}
                  color={colorMode === "light" ? "gray.900" : "white"}
                >
                  Message
                </FormLabel>
                <Textarea
                  id="message"
                  name="message"
                  value={message}
                  onChange={(e) => setMessage(e.target.value)}
                  placeholder="Your Message"
                  fontSize="lg"
                  borderColor={colorMode === "light" ? "gray.400" : "gray.500"}
                  _focus={{
                    borderColor: "green.500",
                    boxShadow: "0 0 0 1px green.500",
                  }}
                  borderRadius="md"
                  p={4}
                  rows={5}
                />
              </FormControl>
              <Button
                type="submit"
                variant="solid"
                colorScheme="green"
                size="lg"
                w="full"
                borderRadius="md"
                boxShadow="md"
                _hover={{ boxShadow: "lg" }}
              >
                Submit
              </Button>
            </form>
          </Box>
        </Flex>
      </Container>
    </Box>
  );
}

export default Contact;
